import react from "react";
import { Link } from "react-router-dom";

const Header = () => {
  return (
    <div className="header-area">
      <h1>Iman & Associates Ltd.</h1>
      <ul>
        <li>
          <Link to="/">Home</Link>
        </li>
        <li>
          <Link to="about/">About</Link>
        </li>
        <li>
          <Link to="contact/">Contact</Link>
        </li>
      </ul>
    </div>
  );
};
export default Header;
